import React from 'react'
import '../css/Style.css';
import NavBar from './rfc/NavBar';
// react-router-dom
import { Link } from 'react-router-dom';
// Material-UI icons
import HomeIcon from '@material-ui/icons/Home';

export default function NotFound() {
    return (
        <div>
            <header>
                <NavBar />
            </header>
            <body>
                <Link to="/">
                    <IconButton edge="start" className={classes.listButton} color="inherit" aria-label="menu">
                        <ListIcon />
                    </IconButton>
                </Link>
                <h1 className="nf">404 Not Found</h1>
                <p className="nf-desc">La page Sidekick que vous avez demand√© est incorrecte.</p>

            </body>
        </div>
    )
}
